import { Link } from 'react-router-dom'

function HeaderTop() {
  return (
    <div className="header-top">
        <Link to="/" className="brand-title">
            <i className="fas fa-book"></i>
            <b className='logo-title'>Bookly</b>
        </Link>
    </div>
  )
}

export default HeaderTop
